import styled from "styled-components"

const H1 = styled.h1`
    text-transform: uppercase;
    font-weight: 900;
    font-size: 4.8rem;
    `

export default function Typography(props) {
    return (
        props.h1 ? <H1>{props.children}</H1> : <div />
    )
}
